import React from 'react';
import './gallery.css'
function Gallery() {
    return (
       
    <div className="App">

      <div className="container-title">
        <div className='background-container'>

        </div>
        <h1 className='title'>
          Приветствую на моем сайте!
          Дипломная работа на тему "Портфолио".
        </h1>
      </div>

    </div>
    );
};
 

export default Gallery;
